//import { useState } from "react"

const Display = (props) => {
  return (
    <div>
      {props.items.map((item, index) => {
        <div key={index}>
          <h1>{item.amount}</h1>
          <h1>{item.desc}</h1>
          <h1>{item.category}</h1>
        </div>;
      })}
    </div>
  );
};
export default Display;
